let text = "the 206 senators attending the voting on Mr. Pita's prime ministerial nomination in parliament, 13 voted in his favour, 34 against and 159 abstained while another 43 senators were absent."

let prepareText = function () {
    //https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/RegExp/global 
    let texts = text.trim().replace('/[?.,!]/g', '').toLowerCase().split(' ')
	//chaining works because in this case everything is acting on a string.

    for (let index = 0; index < texts.length; index++) {
        const element = texts[index];
        if (element === 'a' || element == 'an' || element === 'the') {
            texts.splice(index, 1)
        }
    }
    return texts
}

