interface student {
    id: string
    first_name: string
    last_name: string
    score: number
}

const students: student[] = [
    { id: "65162110011-2", first_name: "Mr.PHONTHAKRON", last_name: "MENTA", score: 30 },
    { id: "65162110083-7", first_name: "MissMANITA", last_name: "SIRIPHURIPHAKORN", score: 29 },
    { id: "65162110128-9", first_name: "MissPHIYADA", last_name: "DAENGWICHAI", score: 28 },
];

